/* After Jacob Frank */==Donmeh West==

Dönmeh West is a non-sectarian, international organization which promotes an original reformulation of Sabbatean and Frankist kabbalism by its founder and leader, Reb Yakov Leib HaKohain. Its website has over 100,000 international visitors to date, and is one of the most-viewed Kabbalah-related websites on the Internet.[1]

