/* History */
'''[[Dragon Radio]]''' is a regional radio station, broadcasting to [[Wales]] on DAB only. It is owned and operated by [[Nation Broadcasting]].

As of June 2023, the station broadcasts to a weekly audience of 51,000, according to [[RAJAR]].<ref>{{cite web |url=https://www.rajar.co.uk/listening/quarterly_listening.php |title=Quarterly Listening |website=rajar.co.uk |access-date=2022-10-30}}</ref

