/* Membership */The local SEVENTH DAY ADVENTIST CHURCH of [[Torre Pellice]] is part of the worldwide Christian community of Seventh Day Adventists. Our church is present in over 200 countries around the world and has over 20 million baptized members.

The first Adventist baptisms outside America were carried out in [[Italy]] in [[1865]] in the [[Angrogna]] stream in [[Torre Pellice]] .

